seq = ""

def product(s, pos, len):
    prod = 1
    for d in s[pos:pos+len]:
        prod = prod * int(d)
    return prod

def maxProd(s, seqLen):
    maxp = 0
    for pos in range(len(s) - seqLen):
        prod = product(s, pos, seqLen)
        if prod > maxp:
            maxp = prod
    return maxp

